string[] lines = inputString.Split("\r\n");
int lineLength = lines[0].Length;
int lineCount = lines.Count();
bool?[,] inputVector = new bool?[lineCount, lineLength];

int password = 0;

for (int i = 0; i < lines.Length; i++)
{
    for (int j = 0; j < lineLength; j++)
    {
        if (lines[i][j] == '@')
        {
            inputVector[i, j] = true;
            int numOfRolls = 0;
            bool[] directions = new bool[8];

            if (i == 0)
            {
                directions[0] = true;
                directions[1] = true;
                directions[2] = true;
            }
            else if (i + 1 >= lines.Length)
            {
                directions[4] = true;
                directions[5] = true;
                directions[6] = true;
            }
            if (j == 0)
            {
                directions[0] = true;
                directions[6] = true;
                directions[7] = true;
            }
            else if (j > lineLength - 2)
            {
                directions[2] = true;
                directions[3] = true;
                directions[4] = true;
            }

            if (!directions[0])
            {
                if (lines[i - 1][j - 1] == '@') numOfRolls++;
            }
            if (!directions[1])
            {
                if (lines[i - 1][j] == '@') numOfRolls++;
            }
            if (!directions[2])
            {
                if (lines[i - 1][j + 1] == '@') numOfRolls++;
            }
            if (!directions[3])
            {
                if (lines[i][j + 1] == '@') numOfRolls++;
            }
            if (!directions[4])
            {
                if (lines[i + 1][j + 1] == '@') numOfRolls++;
            }
            if (!directions[5])
            {
                if (lines[i + 1][j] == '@') numOfRolls++;
            }
            if (!directions[6])
            {
                if (lines[i + 1][j - 1] == '@') numOfRolls++;
            }
            if (!directions[7])
            {
                if (lines[i][j - 1] == '@') numOfRolls++;
            }
            if (numOfRolls < 4)
            {
                inputVector[i, j] = null;
                password++;
            }
        }
        else inputVector[i, j] = false;
    }
}

for (int i = 0; i < lines.Length; i++)
{
    for (int j = 0; j < lines.Length; j++)
    {
        char chr = 'y';
        switch (inputVector[i, j])
        {
            case null:
                chr = 'x';
                break;
            case true:
                chr = '@';
                break;
            case false:
                chr = '.';
                break;
        }
        Console.Write(chr);
    }
    Console.WriteLine();
}

Console.WriteLine("Password: " + password);